import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';
export default function KeywordCheckTable(){

    const columns: GridColDef[] = [
        { field: 'date', headerName: '신청일', width: 70 },
        { field: 'adgoods', headerName: '광고상품', width: 130 },
        { field: 'jobfilter', headerName: '작업구분', width: 130 },
        { field: 'jobName', headerName: '작업명', width: 130 },
        { field: 'jobcondition', headerName: '작업상태', width: 130 },
        { field: 'startjob', headerName: '수행시작', width: 130 },
        { field: 'endjob', headerName: '수행종료', width: 130 },
        { field: 'downloadfile', headerName: '등록파일', width: 130 },
        { field: 'downresult', headerName: '결과', width: 130 },
        { field: 'downcancel', headerName: '대기취소', width: 130 },
        { field: 'requestperson', headerName: '요청자', width: 130 },

    ]

      const rows = [
        { date: '2023-05-17 15:10:50', lastName: 'Snow', firstName: 'Jon', age: 35 },
      ];
    return(
        <div style={{ height: 600, width: '95%',marginLeft:'40px'}}>
        <DataGrid
          rows={rows}
          columns={columns}
          initialState={{
            pagination: {
              paginationModel: { page: 0, pageSize: 10 },
            },
          }}
          pageSizeOptions={[5, 10]}
        />
      </div>
    );
}
